import React from "react";
import Button from "../../../ui/button/button";

const acquire = (props) => (
  <div>
    <div className="search-area">
      <input type="text" placeholder="Enter Title" />
      <Button btnType="fill">Scrape</Button>
    </div>
  </div>
);
export default acquire;
